/**
 * Returns a 32 bit float from the payload, or 1f it null.
 *
 * @param token
 * @return
 */
public float getWeight(Token token) {
  if (token.getPayload() == null || token.getPayload().getData() == null) {
    return 1f;
  } else {
    return PayloadHelper.decodeFloat(token.getPayload().getData());
  }
}

